import styles from './Info.module.scss'
import {Link} from "react-router-dom";
import React from "react";
const Info = ({title, description, onClickClose, imageUrl, Link}) =>{
    return(
        <>
            <img className="mb-20" height={120} width={120} src={imageUrl} alt="empty"/>
            <div className="d-flex flex-column">
                <h3 className="text-center mb-10">{title}</h3>
                <p className="text-center mb-40">{description}</p>
            </div>
            <Link to="/">

            </Link>
            <button className={styles.backCartBtn} onClick={onClickClose}><img src="/img/array-left.png" alt="arrow"/>
                Вернутся назад
            </button>
        </>
    )
}
export default Info
